import { useState } from 'react';

export default function Contact() {
  const [sent, setSent] = useState(false);

  const submit = e => {
    e.preventDefault();
    setSent(true);
  };

  return (
    <section className="container compact">
      <h1>Let‚Äôs work together</h1>

      <div className="contact-layout">

        {/* FORM / SUCCESS */}
        {!sent ? (
          <form className="contact-form" onSubmit={submit}>
            <div className="form-grid">
              <input placeholder="Name" required />
              <input placeholder="Email" required />
            </div>

            <input placeholder="Company Information" />
            <input placeholder="Specific Area of Interest / Concern" />

            <button className="btn">Send Message</button>
          </form>
        ) : (
          <div className="success-box">
            <h2>Message Sent</h2>
            <p>Thank you for reaching out. We‚Äôll be in touch shortly.</p>
          </div>
        )}

        {/* CONTACT INFO PANEL */}
        <div className="contact-side">
          <div className="contact-item">
            <span className="contact-icon">‚úâÔ∏è</span>
            <div>
              <h4>Email</h4>
              <p>contact@archonik.com</p>
            </div>
          </div>

          <div className="contact-item">
            <span className="contact-icon">üìç</span>
            <div>
              <h4>Location</h4>
              <p>Archonik Consulting business address</p>
              <p>4-285K, Manipal - Alevoor Road,<br/> Shanthi Nagar, Manipal, <br/>Karnataka 576104</p>
            </div>
          </div>
        </div>

      </div>
    </section>
  );
}
